import Posts from "./Posts";

function App() {
  return (
    <Router>
      <ul>
        <li>
          <Link to="/">Posts</Link>
        </li>
        <li>
          <Link to="/test">test</Link>
        </li>
      </ul>
      <Switch>
        <Route exact path="/">
          <Posts />
        </Route>
        <Route exact path="/test">
          <h1>Test</h1>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
